import React, { useEffect, useState } from "react";
import Modal from "../UI/Modal";
import { topUpMonitoringServers } from "../../consts/modal";
import { Formik, Field, useFormik, FormikProvider } from "formik";
import { casesApi } from "../../store";
import CustomSelect from "../UI/CustomSelect";
import Loader from "../Loader";

interface MonitoringModalProps {
  isActive: boolean;
  setIsActive: (param: boolean) => void;
}

const CreateCaseModal = ({ isActive, setIsActive }: MonitoringModalProps) => {
  const { data: specializationsInServer, isLoading } =
    casesApi.useGetSpecializationsQuery();
  const select_cost_type = [
    {
      value: "inHour",
      label: "почасовая",
    },
    {
      value: "contract",
      label: "договорная",
    },
    {
      value: "inOrder",
      label: "за проект",
    },
  ];
  const select_specializations = () => {
    return specializationsInServer
      ? specializationsInServer?.specializations.map((item) => {
          return {
            value: item.title,
            label: item.title,
          };
        })
      : [];
  };

  const [description, setDescription] = useState("");
  const [fileList, setFileList] = useState<any>([]);
  const [costType, setCostType] = useState(select_cost_type[0]);
  const [specializations, setSpecializations] = useState(
    select_specializations()[0]
  );

  const handleFileChange = (e: any) => {
    console.log("e.target.files", e.target.files);
    //@ts-ignore
    setFileList([...fileList, ...e.target.files]);
  };

  if (isLoading) return <Loader />;

  return (
    <Modal
      isActive={isActive}
      setIsActive={setIsActive}
      headerTitle={"Cоздание заказа"}
      className="monitoringModal"
    >
      <>
        <div className="monitoringModalContainer">
          <Formik
            initialValues={{ email: "", password: "" }}
            validate={(values) => {
              const errors = {};
              if (!values.email || !values.password) {
                //@ts-ignore
                errors.email = "Заполните все поля";
              } else if (
                !/^[A-Z0-9._%+-]+@[A-Z0-9.-]+\.[A-Z]{2,}$/i.test(values.email)
              ) {
                //@ts-ignore
                errors.email = "Некорректный адрес электронной почты";
              }
              if (values.password.length < 8) {
                //@ts-ignore
                errors.password = "Некорректный пароль";
              }
              return errors;
            }}
            onSubmit={(values, { setSubmitting }) => {
              console.log("files", fileList);
            }}
          >
            {({
              values,
              errors,
              touched,
              handleChange,
              handleBlur,
              handleSubmit,
              isSubmitting,
              /* and other goodies */
            }) => (
              <form
                onSubmit={handleSubmit}
                className="box-form-create-case-modal"
              >
                <div>
                  <p>НАЗВАНИЕ</p>
                  <input
                    type="string"
                    name="email"
                    className="input"
                    onChange={handleChange}
                    value={values.email}
                  />
                </div>

                <div>
                  <p>ОПИСАНИЕ</p>
                  <textarea
                    name={"description"}
                    id="description"
                    rows={4}
                    className="textarea-description"
                    onChange={(e) => setDescription(e.target.value)}
                    value={description}
                  ></textarea>
                </div>

                <div>
                  <p>ФАЙЛЫ</p>
                  <input
                    type="file"
                    name="files"
                    className="input"
                    onChange={handleFileChange}
                  />
                  <ul style={{ paddingTop: 12 }}>
                    {fileList.map((file: any, i: any) => (
                      <li key={i}>{file.name}</li>
                    ))}
                  </ul>
                </div>

                <div>
                  <p>CПЕЦИАЛИЗАЦИЯ</p>

                  <CustomSelect
                    value={costType}
                    options={select_cost_type}
                    onChange={setCostType}
                    isHaveIcon={false}
                    width={"100%"}
                    heightSelect={45}
                    paddingIndicator={0}
                    paddingContainer={12}
                    backgroundColor={"#171226"}
                    menuPlacement={"bottom"}
                  />
                </div>

                <div>
                  <p>ТЭГИ(введите через запятую)</p>
                  <input
                    type="string"
                    name="email"
                    className="input"
                    onChange={handleChange}
                    value={values.email}
                  />
                </div>

                <div>
                  <p>СТОИМОСТЬ</p>
                  <div
                    style={{
                      display: "flex",
                      flexDirection: "row",
                      alignItems: "center",
                      gap: 10,
                    }}
                  >
                    <input
                      type="string"
                      name="email"
                      className="input"
                      onChange={handleChange}
                      style={{ width: "50%" }}
                      value={values.email}
                    />
                    <CustomSelect
                      value={costType}
                      options={select_cost_type}
                      onChange={setCostType}
                      isHaveIcon={false}
                      width={"50%"}
                      heightSelect={45}
                      paddingIndicator={0}
                      paddingContainer={12}
                      backgroundColor={"#171226"}
                      menuPlacement={"top"}
                    />
                  </div>
                </div>

                <button
                  type="submit"
                  disabled={isSubmitting}
                  className="lightBtn btn"
                >
                  {"ЗАРЕГИСТРИРОВАТЬСЯ"}
                </button>
                {(errors.email && touched.email && errors.email) ||
                  (errors.password && touched.password && errors.password)}
              </form>
            )}
          </Formik>
        </div>
      </>
    </Modal>
  );
};

export default CreateCaseModal;
